@SkyTG24 #Pucciarelli: Se vogliamo essere ritenuti Paese serio dobbiamo essere consapevoli di mantenere impegni internazionali sul fronte delle spese militari.

Cosa che è sempre stata fatta anche nei governi Conte I e II, per poi proseguire con Draghi.

@skytg24 #skystart

